import Vue from 'vue';
import App from './App.vue';
import store from './store'; // Vuex store dosyasını içe aktarın

Vue.config.productionTip = false;

new Vue({
  store, // Vuex store'u uygulamaya enjekte edin
  render: h => h(App),
}).$mount('#app');
